import Head from 'next/head';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Layout = props => (
	<div>
		<Head>
			<title>Meeting Planner</title>
			<link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bulma@0.8.0/bulma.sass"/>
			{/* https://cdn.jsdelivr.net/npm/bulma@0.8.0/bulma.sass
https://cdn.jsdelivr.net/npm/bulma@0.8.0/CHANGELOG.md
https://cdn.jsdelivr.net/npm/bulma@0.8.0/LICENSE
https://cdn.jsdelivr.net/npm/bulma@0.8.0/package.json
https://cdn.jsdelivr.net/npm/bulma@0.8.0/README.md */}
			<meta name="viewport" content="width=device-width, initial-scale=1"/>
		</Head>
		<Navbar />
		{props.children}
		<Footer />
	</div>
);

export default Layout;
